            alt="finding-nemo"
          />
        </div>
        <div className="best-action">
          <h2></h2>
          <img
            src="https://media.giphy.com/media/1qhzDBcH8qKGi4snKA/giphy.gif"
            alt="marvel"
          />
        </div>
      </div>
    </>
  );
};

